		public int checkQulity(string imageBase64String  ,string WhichEyes)
		{
			int iResult = 0;
			int quality = 0;

			try
            {
				 
				object tmpImage; 
				int width = 640;
				int height = 480;

				//_iDataIris.GetVersion(0, out string Version);

				imageBytes = Convert.FromBase64String(imageBase64String); 
				_iDataIris.BmpToRaw(imageBytes, imageBytes.Length, out tmpImage, out width, out height);
				imageBytes = tmpImage as byte[];


				if (WhichEyes == "righteye")
                { 
				    base64Right = Convert.ToBase64String(imageBytes);
					
				}
				else if(WhichEyes == "lefteye")
                { 
					base64Left = Convert.ToBase64String(imageBytes); 
				}

				 
                //string base64ImageRepresentation = Convert.ToBase64String(imageBytes);

                //byte[] imageArray = Convert.FromBase64String(base64Right);

                //var path = @"C:\Users\admin\Desktop\accelerator\TestIriscode\file.dat";
                //File.WriteAllBytes(path, imageArray);


                // check contact lens .
                int iContactLensType = int.MinValue;
				int iContactLensScore = int.MinValue;
				iResult = _iDataIris.GetContactLensInformation(Constants.IRIS_IMAGE_RECT, imageBytes, width, height, out iContactLensType,  out iContactLensScore);
				if (iResult != 0 && Constants.IAIRIS_ERROR_CONTACT_LENS != iResult)
				{
					if (iResult == Constants.IAIRIS_LICENCE_EXPIRED)
					{
						Logger.WriteLog("ErrorMessage" + Environment.NewLine + "License expired!");

						throw new Exception("License expired!");

					}
                    else
                    {
                        Logger.WriteLog("ErrorMessage" + Environment.NewLine + string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));

                        throw new Exception(string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));
                    }
                }

                if (iContactLensType != 0)
				{
					return iContactLensType + 100;
				}


				IrisImageQualityInfo_29794 irisImageQualityInfo_29794;
				iResult = _iDataIris.GetIrisImageQuality_ISO29794(Constants.IRIS_IMAGE_RECT, imageBytes, width, height, out quality,
										   out irisImageQualityInfo_29794);

				if (iResult != 0)
				{
					if (iResult == Constants.IAIRIS_LICENCE_EXPIRED)
					{
						Logger.WriteLog("ErrorMessage" + Environment.NewLine + "License expired!");

						throw new Exception("License expired!");

					}
					else
					{
						Logger.WriteLog("ErrorMessage" + Environment.NewLine + string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));

						throw new Exception(string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));
					}
				}

				return quality;

			}
			catch(Exception ex)
            {
				var stackTrace = new StackTrace(ex, true);
				var frame = stackTrace.GetFrame(0);
				var line = frame.GetFileLineNumber();
				Logger.WriteLog("ErrorMessage" + Environment.NewLine + ex.Message + Environment.NewLine + stackTrace + "Line" + line);
				throw ex;
			}

		}

		public bool VerifyMatchesImageSIRIS(string EyeFromSytem, string EyeFromDevice)
		{

            try
            {

				byte[] imageBytesGellery = Convert.FromBase64String(EyeFromSytem); //Convert.FromBase64String("");
				byte[] imageBytesProble = Convert.FromBase64String(EyeFromDevice); //Convert.FromBase64String("");



				int iResult = 0;
				int galleryImageWidth;
				int galleryImageHeight;


				byte[] rawGalleryImage = ImageHelper.ImageToRaw8BitByteArray(ImageHelper.BmpToImage(imageBytesGellery), out galleryImageWidth,
																			 out galleryImageHeight);
				int probeImageHeight;
				int probeImageWidth;
				byte[] rawProbeImage = ImageHelper.ImageToRaw8BitByteArray(ImageHelper.BmpToImage(imageBytesProble), out probeImageWidth,
																		   out probeImageHeight);


				object probeIrisCode;
				ImageInfo probeImageInfo;
				object probeProcessedImage;
				int probeImageQuality = 0;


				iResult = _iDataIris.CreateIrisCode(Constants.IRIS_IMAGE_RECT, rawProbeImage, probeImageWidth,
												   probeImageHeight, out probeIrisCode, out probeProcessedImage,
												   out probeImageQuality, out probeImageInfo);

				if (iResult != 0)
				{
					if (iResult == Constants.IAIRIS_LICENCE_EXPIRED)
					{
						Logger.WriteLog("ErrorMessage" + Environment.NewLine + "License expired!");

						throw new Exception("License expired!");

					}
					else
					{
						Logger.WriteLog("ErrorMessage" + Environment.NewLine + string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));

						throw new Exception(string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));
					}
				}

				float hd;
				iResult = _iDataIris.VerifyByIrisImage(Constants.MATCHING_MODE_STANDARD, 100, rawGalleryImage, galleryImageWidth, galleryImageHeight, probeIrisCode,
													 0.32f, out hd);
				if (iResult != 0 && iResult != Constants.IAIRIS_NOT_MATCHED)
				{
					if (iResult == Constants.IAIRIS_LICENCE_EXPIRED)
					{
						Logger.WriteLog("ErrorMessage" + Environment.NewLine + "License expired!");

						throw new Exception("License expired!");
					}
					else
					{

						Logger.WriteLog("ErrorMessage" + Environment.NewLine + string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));

						throw new Exception(string.Format(@"VerifyIrisImage failed with error  0x{0:X}", iResult));
					}
				}



				if (iResult == Constants.IAIRIS_NOT_MATCHED)
				{
					//Console.WriteLine(@"VERIFY:  FAILED");
					return false;
				}
				else
				{

					//Console.WriteLine(@"Hamming Distance:  " + hd.ToString("0.00"));
					//Console.WriteLine(@"VERIFY:  SUCCESSFUL)");
					return true;
				}

			}
            catch (Exception ex)
            {
				var stackTrace = new StackTrace(ex, true);
				var frame = stackTrace.GetFrame(0);
				var line = frame.GetFileLineNumber();
				Logger.WriteLog("ErrorMessage" + Environment.NewLine + ex.Message + Environment.NewLine + stackTrace + "Line" + line);

				throw new Exception(ex.Message);
			}
		}
	}
